import { useNavigate, useSearchParams } from "react-router-dom";

const Edit = () => {
  const navigate = useNavigate();

  const [searchParams, setSearchParams] = useSearchParams(); //params호출은 배열
  const id = searchParams.get("id"); //데이터 호출은 객체
  console.log(id);
  console.log(searchParams.get("mode"));
  return (
    <div className="Edit">
      <h1>Edit</h1>
      <p>이곳은 일기 수정 페이지 입니다.</p>
      <button
        onClick={() => {
          setSearchParams({ who: "user01" });
        }}
      >
        QS 변경
      </button>
      <button
        onClick={() => {
          navigate("/home");
        }}
      >
        home으로
      </button>
      <button
        onClick={() => {
          navigate(-1);
        }}
      >
        뒤로가기
      </button>
    </div>
  );
};
export default Edit;
